<div class="entities" style="line-height: 2.5; direction: ltr">Sulfasalazine inhibits the growth of primary brain tumors independent of nuclear factor-kappaB . Nuclear factor-kappaB ( NF-kappaB ) is a pleiotropic transcription factor that generally enhances cellular resistance to apoptotic cell death . It has been shown to be constitutively active in some cancers and is being pursued as potential anticancer target . Sulfasalazine which is used clinically to treat Crohn ' s disease has emerged as a potential inhibitor of NF-kappaB and has shown promising results in two pre-clinical studies to target primary brain tumors , gliomas . Once digested , sulfasalazine is cleaved into sulfapyridine and

<div class="entities" style="line-height: 2.5; direction: ltr">Activity , pharmacological inhibition and biological regulation of 3 - hydroxy - 3 - methylglutaryl coenzyme A reductase in Trypanosoma brucei . Activity of hydroxymethylglutaryl-coenzyme A ( HMG - DB01992 ) reductase , the key enzyme in the biosynthesis of steroids and polyisoprenoids in mammalian cells , has been detected in both the bloodstream form and the culture-adapted procyclic form of Trypanosoma brucei ( 3.7 + / - 0.6 and 12.7 + / - 1.8 pmol mevalonate produced min - 1 ( mg cell protein ) - 1 , respectively ) . The enzyme activity is enriched 6 - fold in microsomal fractions . Several competitive inhibitors of mammalian
